import React from "react";
import { Link } from "react-router-dom";
import { ListGroup } from "react-bootstrap";

const Transaction = ({ props }) => {
  return (
    <div className="my-5 justify-content-center w-100">
      <ListGroup defaultActiveKey="#link1">
        <ListGroup.Item className="rounded " variant="light">
          Home
        </ListGroup.Item>
        <ListGroup.Item className="rounded " variant="light">
          Transacciones
        </ListGroup.Item>
        <ListGroup.Item className="rounded " variant="light">
          Historial
        </ListGroup.Item>
      </ListGroup>
    </div>
  );
};

export default Transaction;
